import React, {FC} from 'react';
import styles from "./Paginator.module.css";
import {Pagination} from "@mui/material";

export type PropsPaginatorType = {
  pageSize: number
  totalUsersCount: number
  currentPage: number
  onPageChanged: (event: React.ChangeEvent<unknown>, value: number) => void
  // handleSetPage: (event: React.ChangeEvent<unknown>, value: number) => void
}

export const Paginator: FC<PropsPaginatorType> = ({pageSize, currentPage, totalUsersCount,
                                                    onPageChanged}) => {

  let pagesCount = Math.ceil(totalUsersCount / pageSize)

  let pages = [];

  for (let i = 1; i <= pagesCount; i++) {
    pages.push(i);
  }

  return (
    <div>
      <Pagination
        count={pagesCount}
        onChange={()=>{}}
      />
      {pages.map((p, index) => {
        return (
          <Pagination
            count={pagesCount}
            onChange={onPageChanged}
          />
          // <span key={index} className={currentPage === p ? styles.selectedPage : 'default'}
          //       onClick={(e) => {
          //         onPageChanged(p)
          //       }}>{p}</span>
        )
      })
      }
    </div>
  );
};
